import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Wait for the first product card using a unique product title text
    await page.waitForSelector('text=Apple iPhone 15 Pro Max', { timeout: 5000 });

    // Click the product card by its title (using text selector)
    await page.click('text=Apple iPhone 15 Pro Max');

    // Wait for the product detail modal to appear (look for Add to Wish List button by text)
    await page.waitForSelector('button:has-text("Add to Wish List")', { timeout: 5000 });

    // Take screenshot of product detail modal
    const step2 = path.join(screenshotsDir, 'step_2_product_detail.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Click the "Add to Wish List" button (using button text)
    await page.click('button:has-text("Add to Wish List")');

    // Wait for notification to appear (using notification class)
    await page.waitForSelector('.notification.success', { timeout: 5000 });

    // Take screenshot after adding to wishlist
    const step3 = path.join(screenshotsDir, 'step_3_added_to_wishlist.png');
    await page.screenshot({ path: step3 });
    screenshots.push(step3);

    // Close the product modal (using close button with class "close" inside modal)
    const closeBtn = await page.$('#productModal .close');
    if (closeBtn) {
      await closeBtn.click();
    }

    // Open the wishlist page (use navigation link or button with text "Your Wish List")
    // Try to find a visible "Your Wish List" link in the nav/footer
    const wishListLinks = await page.$$('a:has-text("Your Wish List")');
    let clicked = false;
    for (const link of wishListLinks) {
      if (await link.isVisible()) {
        await link.click();
        clicked = true;
        break;
      }
    }
    // If not found, try to call the showWishlist JS function directly
    if (!clicked) {
      await page.evaluate(() => {
        if (typeof showWishlist === 'function') showWishlist();
      });
    }

    // Wait for the wishlist page to load (look for wishlist-page class)
    await page.waitForSelector('.wishlist-page', { timeout: 5000 });

    // Take screenshot of wishlist page
    const step4 = path.join(screenshotsDir, 'step_4_wishlist_page.png');
    await page.screenshot({ path: step4 });
    screenshots.push(step4);

    // Extract the titles of wishlist items for verification
    const wishlistTitles = await page.$$eval('.wishlist-title', nodes => nodes.map(n => n.textContent.trim()));

    return {
      success: true,
      action: "Added 'Apple iPhone 15 Pro Max' to wishlist and verified its presence in the wishlist page.",
      extractedData: {
        wishlistTitles
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
